    "### Threshold Selection\n",
    "\n",
    "Due to the small sample size (especially of cluster 2) I will not run a decision tree per cluster. For the decision tree I will use a sleep efficiency threshold of 0.94, which is the overall median for the whole sample. \n",
    "\n",
    "Below I create `activity_goal` which will serve as the binary outcome variable of whether or not users meet the activity goal, i.e., a sleep efficiency score of 0.94 or above."
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 8,
   "id": "8e1b06c7",
   "metadata": {
    "execution": {
     "iopub.execute_input": "2025-03-26T05:27:47.648655Z",
