     "shell.execute_reply": "2025-03-26T05:27:47.663452Z"
    },
    "papermill": {
     "duration": 0.03106,
     "end_time": "2025-03-26T05:27:47.667939",
     "exception": false,
     "start_time": "2025-03-26T05:27:47.636879",
     "status": "completed"
    },
    "tags": []
   },
   "outputs": [],
   "source": [
    "activity_goal <- .94\n",
    "\n",
    "user_averages_with_clusters <- user_averages_with_clusters %>%\n",
    "  mutate(\n",
    "    ActivityGoalMet = ifelse(Cluster == 1 & !is.na(AvgSleepEfficiency) & AvgSleepEfficiency >= activity_goal |\n",
    "                               Cluster == 2 & !is.na(AvgSleepEfficiency) & AvgSleepEfficiency >= activity_goal, 1, 0)\n",
    "  )"
   ]
