    "### Decision Tree\n",
    "\n",
    "Below I use `rpart` to run a decision tree model for all of our users. I will use a combination of activity metrics as predictors for our model (average very active minutes, average fairly active minutes, average lightly active minutes, average sedentary minutes, and average total steps).\n",
    "\n",
    "#### Code Explanation\n",
    "**Workflow Inside the Loop:**\n",
    "* Only complete cases are used to build the model.\n",
    "* A formula is constructed where ActivityGoalMet (converted to a factor) is predicted using the selected predictors.\n",
    "\n",
    "**Decision Tree Modeling:**\n",
    "* The rpart package is used to build a decision tree.\n",
    "* The control parameters (minsplit = 2, minbucket = 1) allow the tree to split even on small samples.\n",
    "\n",
    "**Model Evaluation and Plotting:**\n",
    "* A summary of the model is printed.\n",
    "* If the tree contains more than one terminal node (i.e., it found significant splits) then it is visualized with rpart.plot.\n",
    "* If no splits were found or an error occurs, appropriate messages are displayed.\n",
    "\n",
    "**Error Handling:** The tryCatch block captures any errors during model building (for example, due to data issues) and outputs an error message, ensuring the loop continues to process subsequent clusters.\n",
    "\n",
    "**In summary, this code builds and visualizes a decision tree model to understand what factors predict whether users meet their sleep efficiency activity goal. This is used to drive personalized recommendations tailored to each user's unique patterns.**"
   ]
  },
