   "source": [
    "options(repr.plot.width = 20, repr.plot.height = 30) # Adjust width and height of rpart plot\n",
    "\n",
    "# Here, a vector of predictor variable names is defined. \n",
    "predictors <- c(\"AvgVeryActiveMinutes\", \"AvgFairlyActiveMinutes\", \"AvgLightlyActiveMinutes\",\n",
    "                \"AvgSedentaryMinutes\", \"AvgTotalSteps\")\n",
    "\n",
    "# Build a decision tree model \n",
    "complete_cases <- complete.cases(user_averages_with_clusters[, predictors])\n",
    "\n",
    "model_data <- user_averages_with_clusters[complete_cases, ]\n",
    "\n",
    "formula <- as.formula(paste(\"as.factor(ActivityGoalMet) ~\", paste(predictors, collapse = \" + \")))\n",
    "  \n",
    "  tryCatch({\n",
    "    tree_model <- rpart(formula, data = model_data, method = \"class\", \n",
    "                        control = rpart.control(minsplit = 2, minbucket = 1))\n",
    "    \n",
    "    print(summary(tree_model))\n",
    "    \n",
    "    if(nrow(tree_model$frame) > 1) {\n",
    "      rpart.plot(tree_model, main = paste(\"Decision Tree for Users\"))\n",
    "    } else {\n",
    "      cat(\" - Model did not find any significant splits in the data.\n",
    "\")\n",
    "    }\n",
    "  }, error = function(e) {\n",
